    const std::size_t * lookup_ = lookup_arr_[start_state_];
    std::size_t dfa_alphabet_ = dfa_alphabet_arr_[start_state_];
    const std::size_t *dfa_ = dfa_arr_[start_state_];
    const std::size_t *ptr_ = dfa_ + dfa_alphabet_;
    Iterator curr_ = start_token_;
    bool end_state_ = *ptr_ != 0;
    std::size_t id_ = *(ptr_ + id_index);
    std::size_t uid_ = *(ptr_ + unique_id_index);
    std::size_t end_start_state_ = start_state_;
    Iterator end_token_ = start_token_;

    while (curr_ != end_)
    {
        const std::size_t EOL_state_ = ptr_[eol_index];

        if (EOL_state_ && *curr_ == '\n')
        {
            ptr_ = &dfa_[EOL_state_ * dfa_alphabet_];
        }
        else
        {
            const std::size_t state_ =
                ptr_[lookup_[static_cast<unsigned char>(*curr_++)]];

            if (state_ == 0) break;

            ptr_ = &dfa_[state_ * dfa_alphabet_];
        }

        if (*ptr_)
        {
            end_state_ = true;
            id_ = *(ptr_ + id_index);
            uid_ = *(ptr_ + unique_id_index);
            end_start_state_ = *(ptr_ + state_index);
            end_token_ = curr_;
        }
    }

    const std::size_t EOL_state_ = ptr_[eol_index];

    if (EOL_state_ && curr_ == end_)
    {
        ptr_ = &dfa_[EOL_state_ * dfa_alphabet_];

        if (*ptr_)
        {
            end_state_ = true;
            id_ = *(ptr_ + id_index);
            uid_ = *(ptr_ + unique_id_index);
            end_start_state_ = *(ptr_ + state_index);
            end_token_ = curr_;
        }
    }

    if (end_state_)
    {
        // return longest match
        start_state_ = end_start_state_;
        start_token_ = end_token_;

        if (id_ == 0)
        {
            goto again;
        }
    }
    else
    {
        // No match causes char to be skipped
        ++start_token_;
        id_ = npos;
        uid_ = npos;
    }

    unique_id_ = uid_;
    return id_;
